    private boolean handleTrip(TripData tripData) {
        logger.info("GTFS trip {}",tripData.getSiriTripId());
        logger.info("oad {}",tripData.getOriginalAimedDeparture());
        //logger.info(" has siri points: {}", tripData.getSiri() != null);
        logger.info("siri points: {}", tripData.getSiri().features.length);
        String result = investigateTrip(tripData);
        return true;
    }

    private String investigateTrip(TripData tripData) {
        if (tripData == null) return "";
        if (tripData.getSiri() == null) return "Did not start (No Siri Data)";
        
        if (tripData.getSuspicious()) {
            return investigateSuspiciousTrip(tripData);
        }
        
        // left with "regular" trips. We have shape, GTFS Stops location, and a list of Siri points.
        // Usually this is a "good" trip.
        // To see if it started late, we need to find several points at the start, 
        // see that the distance from start point is monotonically growing - this rules out cases of bus atill at the end of its previous trip on the same shape in the opposite direction
        // see that all points are on the shape (small delta) - this rules out the bus transmitting, but doing a totally different route
        
        // for routes with second/third stop close enough to start point, let us see when the bus arrived at those stops.
        // comparing this to expected time at those stops, we can see if the bus started late.
        String shape = shapeService.findShape(tripData.getRouteId(), tripData.getDate());   // TODO should be already in TripData
        findIfAllSiriPointsAreOnShape(tripData, shape);
        String[] startCoordinates = tripData.getStops().features[0].geometry.coordinates;
        return null;
    }

    private void findIfAllSiriPointsAreOnShape(TripData tripData, String shape) {
        SiriFeature[] features = tripData.getSiri().features;
        for (int index = 0 ; index < features.length; index++) {
            String[] point = features[index].geometry.coordinates;
            pointOnShapeWithTolerance(point, shape, 20 /* meters */);
        } 
    }

    private void pointOnShapeWithTolerance(String[] point, String shape, int i) {
        //org.locationtech.jts.linearref.
        Geometry geometry;
        try {
            String json =
                "{\"type\": \"LineString\",\"coordinates\": " +
                shape.split("\"shape\":")[1];
            geometry = (new GeoJsonReader()).read(json);
        } catch (ParseException e) {
            logger.error("during parsing json of shape", e);
            return;
        }
        //WGS84
        final int SRID = 4326;
        GeometryFactory factory = new GeometryFactory(new PrecisionModel(PrecisionModel.FLOATING), SRID);
        //CoordinateSequenceFactory coordinateSequenceFactory = CoordinateSequenceFactory.
        Coordinate[] coordinates = geometry.getCoordinates();
        CoordinateSequence points = CoordinateArraySequenceFactory.instance().create(coordinates);
        Geometry linearGeom = new LineString(points, factory);
        LengthIndexedLine x = new LengthIndexedLine(linearGeom);
        logger.info("startIndex={}, endIndex={}", x.getStartIndex(), x.getEndIndex());
        for ( double index = x.getStartIndex() ; index < x.getEndIndex() ; index = index + 0.01 ) {
            Coordinate c = x.extractPoint(index);
            logger.info("{} - {}", index, c);
        }

    }

