    static final MathTransform transformer = computeOnce();

    private static MathTransform computeOnce() {
        try {
            return CRS.findMathTransform(CRS.decode("EPSG:4326", false), CRS.decode("EPSG:2039", false), true);
        }
        catch (Exception ex) {
            return null;
        }
    }

    private String constructWktFromShape(String shape) throws ParseException {
        String coordsInShape = shape.split("\"shape\":")[1];
        logger.info("{}", coordsInShape);
        String json =
                "{\"type\": \"LineString\",\"coordinates\": " +
                        shape.split("\"shape\":")[1];
        Geometry geometry = (new GeoJsonReader()).read(json);
        Coordinate[] coords = geometry.getCoordinates();
        java.util.List<Coordinate> utmCoords = Arrays.stream(coords).map(coordinate -> new Coordinate(convertLatLonToITM(coordinate, transformer))).collect(Collectors.toList());
        List<Coordinate> utmCoords2 = List.of(coords).map(coordinate -> new Coordinate(convertLatLonToITM(coordinate, transformer)));
        String coordsAsStr = utmCoords2.map(coord -> " " + coord.getX() + " " + coord.getY()).collect(Collectors.joining(","));
        String lineString = "LINESTRING (" + coordsAsStr + ")";
        return lineString;
    }


