    public static Coordinate convertLatLonToITM(Coordinate coordinate, MathTransform mathTransform) {   //throws FactoryException, MismatchedDimensionException, TransformException {
        Point point = (new GeometryFactory()).createPoint( coordinate);
        try {
            Geometry g = JTS.transform(point, mathTransform);
            return g.getCoordinate();
        }
        catch (Exception ex) {
            return null;
        }
    }

    public static Geometry convertLatLonToITM(double lat, double lon) throws FactoryException, MismatchedDimensionException, TransformException {
        // following should be done only once
        CoordinateReferenceSystem sourceCRS = CRS.decode("EPSG:4326", false);   //geographic;
        CoordinateReferenceSystem targetCRS = CRS.decode("EPSG:2039", false);   //itm;
        MathTransform mathTransform = CRS.findMathTransform( sourceCRS, targetCRS,true );

        Point point = (new GeometryFactory()).createPoint( new Coordinate( lat, lon ) );

        Geometry g = JTS.transform(point, mathTransform);
        logger.info("ITM: geometry: {}", g);

        // 05
        //Geometry g2 = JTS.transform(point, CRS.findMathTransform( sourceCRS, itm05,true ));
        //logger.info("IG05: geometry: {}", g);

        double[] p = new double[]{g.getCoordinates()[0].getX(), g.getCoordinates()[0].getY()};
        logger.info("p={},{}", p[0], p[1]);
        return g;
    }
